(2, 'hadir', 937, 463, '2014-09-29', 40, 'Pertemuan Kedua\nImplementasi Tiga kerangka dasar ajaran Islam ( Aqidah, Akhlak, dan Syariah ).\nDimana yg menjadi point pembahasan adalah Akhlak. \nuntuk Peserta mentoring, jangan lupa cek terus akun mentoringnya, Jangan lupa Buku Mentoringnya baca terus. \ntugas untuk minggu ketiga => Riview ( baca kembali ) pembahasan tentang akhlak, kemudian baca juga pembahasan tentang ibadah di chapter selanjutnya.\nKemudian dikarenakan Hari Senin tanggal 06 Oktober 2014, libur kuliah. Maka untuk Kelompok ini, ada tugas. Nanti di informasikan lagi untuk tugas nya.\nttd\nKang Syaf', '1121', 200),
